def entance(arr):
    low = 1
    high = len(arr) - 1
    if high < 0:
        return None
    if high == 0:
        return arr[0]
    if arr[low] <= arr[high]:
        return arr[high]
    while low <= high:
        mid = (low + high) // 2
        if mid < len(arr) - 1 and arr[mid] > arr[mid + 1]:
            return arr[mid]
        if arr[mid] >= arr[low]:
            low = mid + 1
        else:
            high = mid - 1
    return None

